useEffect(() => {
 axios.get('https://jsonplaceholder.typicode.com/posts/${id} ' )
    .then(res => {
        console.log(res);
        setPost(res.data);

    }).catch(err=>{
console.log(err);
    })

},[])



  return (
    <div>
        <h2>PhotoList</h2>

